import {sendMessageActionCreator, updateNewMessageBody} from "../../redux/messages-reducer";
import Dialogs from "./Dialogs";
import {connect} from "react-redux";
import {withAuthRedirect} from "../../hoc/withAuthRedirect";
import {compose} from "redux";



let mapStateToProps = (state) =>
{
    return {
        DialogsProfiles: state.messagesPage.profiles,
        DialogsMessages: state.messagesPage.dialogs,
        newMessageBody: state.messagesPage.newMessageBody,
        isAuth: state.auth.isAuth
    }
}

let mapDispatchToProps = (dispatch) =>{
    return{
        updateNewMessageBody: (text) =>{dispatch(updateNewMessageBody(text))},
        sendMessage: () =>{dispatch(sendMessageActionCreator());}
    }
}

compose(
    connect(mapStateToProps,mapDispatchToProps),
    withAuthRedirect
)(Dialogs)

let AuthRedirectContainer = withAuthRedirect(Dialogs)

const DialogsContainer = connect(mapStateToProps,mapDispatchToProps)(AuthRedirectContainer);

export default DialogsContainer;
